    false,nt"url": null,nt"notes": "The use of Airborne Data Acquisistion and
    Registration (ADAR) imaging system was used to create a map displaying existing
    plant communities within the Nature Reserve of Orange County's coastal subregion.
    The vegetation classification was based on Jones & Stokes, 1993, with some modifications
    based on vegetation characteristics in the subregion. For a complete list of habitat
    codes with decision rules, see Appendix B of the associated report ADAR-Based Mapping
    of the Nature Reserve of Orange County, for The Nature Conservancy and California
    Department of Fish and Game, prepared by Ed Almanza and Associates, https://nrm.dfg.ca.gov/FileHandler.ashx?DocumentID=17016.
    See also Gray and Bramlet 1992 (https://nrm.dfg.ca.gov/FileHandler.ashx?DocumentID=99370)
    and Jones and Stokes 1993 (https://nrm.dfg.ca.gov/FileHandler.ashx?DocumentID=99373).
    What Each Record Represents: Each polygon represents a discrete plant community.",nt"license_title":
